import React, { Component } from "react";
import Navbar from "../Component/Navbar";
import Home from "../Component/home";
import About from "../Component/about";
import Experince from "../Component/experince";
import headshot from "../images/headshot.jpg";
import instagram from "../images/instagram.png";
import github from "../images/github.png";
import linkdlen from "../images/linkdlen.png";
import twitter from "../images/twitter.png";
import resume from "../images/resume.png";
import email from "../images/email.png";
import PDF from "../images/resume.pdf";
import IBC_team from "../images/IBC_team.JPG";
import IBC from "../images/IBC.gif";
import Leadership from "../images/Leadership.JPG";
import {
  dummyText,
  about_text,
  contact_text,
  Welcome_text,
  IBC_text,
  role_text,
  role2_text,
} from "../Component/text";

export default class NavbarLinker extends Component {
  render() {
    return (
      <div className="NavBarLinker">
        <Navbar />
        <Home
          title="Home"
          subtitle={Welcome_text}
          contact_text={contact_text}
          dark={true}
          id="Home"
          pic1={github}
          pic2={linkdlen}
          pic3={instagram}
          pic4={twitter}
          pic5={resume}
          pic6={email}
          Pdf={PDF}
        />
        <About
          title="About"
          subtitle={about_text}
          dark={false}
          id="About"
          img_src={headshot}
        />
        <Experince
          title="Professional Experience"
          subtitle={IBC_text}
          dark={true}
          img_src={IBC}
          img_src2={IBC_team}
          subtext2={role_text}
          subtext3={role2_text}
          id="Professional Experience"
        />
        <About
          title="Extracurriculars"
          subtitle=""
          dark={false}
          id="Extracurriculars"
        />
      </div>
    );
  }
}
